import logo from './logo.svg';
import './App.css';
import axios from 'axios';
import { useEffect, useState } from 'react';

function App() {
  const [siriData, setSiriData] = useState('');

  useEffect(() => {
    axios.get('https://localhost/publicTransportation.php')
      .then((res) => {
        setSiriData(res.data); // Assuming res.data contains the Siri data
      })
      .catch((err) => {
        console.error('Error fetching data:', err);
      });
  }, []);

  function ShowData({ Siri }) {
    return (
      <h2>{Siri}</h2>
    );
  }

  return (
    <div className="App">
      <ShowData Siri={siriData} />
    </div>
  );
}

export default App;
